import React from "react";

//Affichage de la page
class Main extends React.Component {
    //Affichage de la page
    render(){
        return (
            <div class="container">
            
                <div class="row">
                    <h1 className="font">Overview</h1>   
                </div>

                <div class="row" className="top">
                      <div class="col">
                        <button className="butts" >bouton1</button>
                        <button className="butts" >bouton2</button>
                        <button className="butts" >bouton3</button>
                        <button className="butts" >bouton4</button>
                      </div>   
                </div>

                <div class ="row">
                    <div className="mid">
                        <article>
                        yo
                        </article>
                    </div>
                </div>

                
        
        </div>
    );
}
}

export default Main;
